import React from "react";

const Card = () => {
  return (
    <div className="bg-[#0092db] rounded-lg shadow-lg overflow-hidden w-64 text-center">
      <div className="relative mx-auto p-6 pb-4">
        <img
          className="rounded-full h-32 w-32 object-cover mx-auto"
          src="https://cdn.pixabay.com/photo/2023/10/16/10/51/fox-8318961_1280.png"
          alt="Profile"
        />
      </div>
      <div className="px-4 py-5 text-center">
        <h3 className="text-lg leading-6 font-medium text-gray-100">
          John Doe
        </h3>
        <p className="mt-1 max-w-2xl text-sm text-gray-300">Department: IT</p>
        <p className="mt-1 max-w-2xl text-sm text-gray-300">Campus: New York</p>
      </div>
    </div>
  );
};

export default Card;
